        arr = [False] * m
        flag = 0
        for i in range(n):
            c = 0
            for j in range(m):
                if joy_matrix[i][j] >= num:
                    arr[j] = True
                    c += 1
            if c > 1:
                flag = 1
        if not flag and m > 0:
            return False
        ans = True
        for i in arr:
            ans = ans and i
        return ans
    low = 1
    high = 2
    while can_achieve_joy(high):
        high *= 2
    while high - low > 1:
        mid = (low + high) // 2
        if can_achieve_joy(mid):
            low = mid
        else:
            high = mid
    return low

